import React, { useRef, useEffect, useState, useCallback } from "react";
import mojs from "@mojs/core";
const EarthQuake = ({ duration, earthRef, e }) => {
  const bouncyCircle = new mojs.Shape({
    parent: earthRef.current,
    shape: "circle",
    fill: "none",
    radius: 25,
    strokeWidth: { 50: 0 },
    scale: { 0: 1 },
    angle: { "rand(-35, -70)": 0 },
    duration: duration,
    easing: "cubic.out",

    radius: { 0: 15 },
    strokeWidth: { 30: 0 },
    stroke: "magenta",
    delay: "rand(75, 150)",
  });

  bouncyCircle.tune({ x: e.offsetX, y: e.offsetY }).replay();
};

export default EarthQuake;
